hljs.registerLanguage(
  "ldif",
  (() => {
    "use strict";
    return ({ HASH_COMMENT_MODE }) => {
      return {
        name: "LDIF",
        contains: [
          {
            className: "attribute",
            begin: "^dn",
            end: ": ",
            excludeEnd: !0,
            starts: { end: "$", relevance: 0 },
            relevance: 10,
          },
          {
            className: "attribute",
            begin: "^\\w",
            end: ": ",
            excludeEnd: !0,
            starts: { end: "$", relevance: 0 },
          },
          { className: "literal", begin: "^-", end: "$" },
          HASH_COMMENT_MODE,
        ],
      };
    };
  })()
);
